//objetos 

const persona = {
    nombre: 'tony',
    apellido: 'stark',
    edad: 45,
    direccion: {
        ciudad: 'New york',
        CP: '6466374',
        lat: '47.8877',
        lng: '34.876574',
    }

};


//console.table({persona});



const persona2 = {...persona}; //asignacion de referencia
persona2.nombre = 'Peter';


console.log(persona);
console.log(persona2);
